{
  "translationLines": [
    {
      "lineNumber": 107291,
      "originalJapaneseLine": "「はい、ありがとうございます。",
      "translatedEnglishLine": "\"Yes, thank you very much.\""
    },
    {
      "lineNumber": 107292,
      "originalJapaneseLine": "　御主人様」",
      "translatedEnglishLine": "Master.\""
    },
    {
      "lineNumber": 107293,
      "originalJapaneseLine": "私はここに来てから、",
      "translatedEnglishLine": "Since coming here,"
    },
    {
      "lineNumber": 107294,
      "originalJapaneseLine": "初めて笑顔を浮かべた。",
      "translatedEnglishLine": "I smiled for the first time."
    },
    {
      "lineNumber": 107295,
      "originalJapaneseLine": "ああ、そうだ。",
      "translatedEnglishLine": "Ah, that's right."
    },
    {
      "lineNumber": 107296,
      "originalJapaneseLine": "笑顔の浮かべ方ってこうだ。",
      "translatedEnglishLine": "This is how you wear a smile."
    },
    {
      "lineNumber": 107297,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 107298,
      "originalJapaneseLine": "「？　如何致しました？」",
      "translatedEnglishLine": "\"? What happened?\""
    },
    {
      "lineNumber": 107299,
      "originalJapaneseLine": "「いんや、なんでもない」",
      "translatedEnglishLine": "\"No, it's nothing.\""
    },
    {
      "lineNumber": 107300,
      "originalJapaneseLine": "「よしよし」",
      "translatedEnglishLine": "\"There, there.\""
    },
    {
      "lineNumber": 107301,
      "originalJapaneseLine": "御主人様が私の頭をわしゃわしゃと乱暴に撫でる。",
      "translatedEnglishLine": "Master roughly tousled my hair."
    },
    {
      "lineNumber": 107302,
      "originalJapaneseLine": "前は怖くて仕方なかったこの大きな手が、",
      "translatedEnglishLine": "Before, these big hands terrified me,"
    },
    {
      "lineNumber": 107303,
      "originalJapaneseLine": "今はホッと安心する。",
      "translatedEnglishLine": "but now they make me feel safe and relieved."
    },
    {
      "lineNumber": 107304,
      "originalJapaneseLine": "撫でられている間、",
      "translatedEnglishLine": "While being petted,"
    },
    {
      "lineNumber": 107305,
      "originalJapaneseLine": "私はにゃんにゃんのように、",
      "translatedEnglishLine": "I gently squinted my eyes like a cat."
    },
    {
      "lineNumber": 107306,
      "originalJapaneseLine": "そっと目を細めていた。",
      "translatedEnglishLine": "Quietly narrowing my eyes."
    },
    {
      "lineNumber": 107307,
      "originalJapaneseLine": "「明日も頼むぞ」",
      "translatedEnglishLine": "\"I'm counting on you tomorrow, too.\""
    },
    {
      "lineNumber": 107308,
      "originalJapaneseLine": "「はい、明日もさせて頂きます」",
      "translatedEnglishLine": "\"Yes, I will do my best tomorrow as well.\""
    },
    {
      "lineNumber": 107309,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 107310,
      "originalJapaneseLine": "廊下に出て、周りに誰もいないことを確認する。",
      "translatedEnglishLine": "I stepped out into the hallway and confirmed no one was around."
    },
    {
      "lineNumber": 107311,
      "originalJapaneseLine": "「ぅ……」",
      "translatedEnglishLine": "\"Ugh...\""
    },
    {
      "lineNumber": 107312,
      "originalJapaneseLine": "私は口元に手を当て、",
      "translatedEnglishLine": "I put my hand to my mouth,"
    },
    {
      "lineNumber": 107313,
      "originalJapaneseLine": "その場で何度も小さく飛び跳ねた。",
      "translatedEnglishLine": "and repeatedly jumped softly in place."
    },
    {
      "lineNumber": 107314,
      "originalJapaneseLine": "ぴょんぴょん、ぴょんぴょん。",
      "translatedEnglishLine": "Hop hop, hop hop."
    },
    {
      "lineNumber": 107315,
      "originalJapaneseLine": "自分でもよく分からなかったけど、",
      "translatedEnglishLine": "I didn't really understand it myself,"
    },
    {
      "lineNumber": 107316,
      "originalJapaneseLine": "とにかくそうしたい気分だった。",
      "translatedEnglishLine": "but I just felt like doing it."
    },
    {
      "lineNumber": 107317,
      "originalJapaneseLine": "ぴょんぴょん、ぴょんぴょん。",
      "translatedEnglishLine": "Hop hop, hop hop."
    },
    {
      "lineNumber": 107318,
      "originalJapaneseLine": "「ぅぁ……」",
      "translatedEnglishLine": "\"Uah...\""
    },
    {
      "lineNumber": 107319,
      "originalJapaneseLine": "すごく嬉しい。嬉しい嬉しい嬉しい。",
      "translatedEnglishLine": "I'm very happy. Happy, happy, happy."
    },
    {
      "lineNumber": 107320,
      "originalJapaneseLine": "褒められた。嬉しい。とても嬉しい。",
      "translatedEnglishLine": "I was praised. I'm happy. Very happy."
    },
    {
      "lineNumber": 107321,
      "originalJapaneseLine": "そっか。",
      "translatedEnglishLine": "I see."
    },
    {
      "lineNumber": 107322,
      "originalJapaneseLine": "笑いかけられたら、笑い返せば良かったのか。",
      "translatedEnglishLine": "If someone smiled at me, I should have smiled back."
    },
    {
      "lineNumber": 107323,
      "originalJapaneseLine": "…………",
      "translatedEnglishLine": "........"
    },
    {
      "lineNumber": 107324,
      "originalJapaneseLine": "……",
      "translatedEnglishLine": "..."
    },
    {
      "lineNumber": 107325,
      "originalJapaneseLine": "明日も頑張ろう。",
      "translatedEnglishLine": "I'll do my best tomorrow, too."
    },
    {
      "lineNumber": 107326,
      "originalJapaneseLine": "「がははは、温泉だー！」",
      "translatedEnglishLine": "\"Gahaha, it's the hot springs!\""
    },
    {
      "lineNumber": 107327,
      "originalJapaneseLine": "「はーい」",
      "translatedEnglishLine": "\"Yes!\""
    },
    {
      "lineNumber": 107328,
      "originalJapaneseLine": "「今日はロナも一緒だー！」",
      "translatedEnglishLine": "\"Rona is coming with us today too!\""
    },
    {
      "lineNumber": 107329,
      "originalJapaneseLine": "「……はい。宜しくお願い致します」",
      "translatedEnglishLine": "\"...Yes. Please take care of me.\""
    },
    {
      "lineNumber": 107330,
      "originalJapaneseLine": "「まずはロナ、俺の背中を流せ」",
      "translatedEnglishLine": "\"First, Rona, wash my back.\""
    },
    {
      "lineNumber": 107331,
      "originalJapaneseLine": "「かしこまりました」",
      "translatedEnglishLine": "\"Certainly.\""
    },
    {
      "lineNumber": 107332,
      "originalJapaneseLine": "「わしわし、わしわし……」",
      "translatedEnglishLine": "\"Wash wash, wash wash...\""
    },
    {
      "lineNumber": 107333,
      "originalJapaneseLine": "「がははは、念入りに洗えよー」",
      "translatedEnglishLine": "\"Gahaha, wash thoroughly!\""
    },
    {
      "lineNumber": 107334,
      "originalJapaneseLine": "「はい、かしこまりました。",
      "translatedEnglishLine": "\"Yes, certainly."
    },
    {
      "lineNumber": 107335,
      "originalJapaneseLine": "　わしわし、わしわし……」",
      "translatedEnglishLine": "Wash wash, wash wash...\""
    },
    {
      "lineNumber": 107336,
      "originalJapaneseLine": "「シィルもちゃんとロナの背中を洗ってるかー？」",
      "translatedEnglishLine": "\"Shiru, are you properly washing Rona's back too?\""
    },
    {
      "lineNumber": 107337,
      "originalJapaneseLine": "「はーい、洗ってますよ、ランス様」",
      "translatedEnglishLine": "\"Yes, I'm washing, Lord Rance.\""
    },
    {
      "lineNumber": 107338,
      "originalJapaneseLine": "「よし、交代！」",
      "translatedEnglishLine": "\"Alright, switch!\""
    },
    {
      "lineNumber": 107339,
      "originalJapaneseLine": "並んで座っていた三人がくるりと反転。",
      "translatedEnglishLine": "The three who had been sitting side by side turned around."
    },
    {
      "lineNumber": 107340,
      "originalJapaneseLine": "「今度はロナの背中を洗ってやるぞー。",
      "translatedEnglishLine": "\"Now I'll wash Rona's back."
    },
    {
      "lineNumber": 107341,
      "originalJapaneseLine": "　わっしわっし、わっしわっし」",
      "translatedEnglishLine": "Wash wash, wash wash!\""
    },
    {
      "lineNumber": 107342,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 107343,
      "originalJapaneseLine": "「うう……筋張ってる……",
      "translatedEnglishLine": "\"Ugh... so muscular..."
    },
    {
      "lineNumber": 107344,
      "originalJapaneseLine": "　このまま成長されちゃちっとも楽しくないぞぉ」",
      "translatedEnglishLine": "If you keep growing like this, it won't be fun at all.\""
    },
    {
      "lineNumber": 107345,
      "originalJapaneseLine": "「？？」",
      "translatedEnglishLine": "\"??\""
    },
    {
      "lineNumber": 107346,
      "originalJapaneseLine": "「もっと食えよ」",
      "translatedEnglishLine": "\"Eat more.\""
    },
    {
      "lineNumber": 107347,
      "originalJapaneseLine": "「はい、かしこまりました」",
      "translatedEnglishLine": "\"Yes, understood.\""
    },
    {
      "lineNumber": 107348,
      "originalJapaneseLine": "「温泉に入って温まるぞー」",
      "translatedEnglishLine": "\"Let's get in the hot springs and warm up!\""
    },
    {
      "lineNumber": 107349,
      "originalJapaneseLine": "「はーい」",
      "translatedEnglishLine": "\"Yes!\""
    },
    {
      "lineNumber": 107350,
      "originalJapaneseLine": "「はい、かしこまりました」",
      "translatedEnglishLine": "\"Yes, certainly.\""
    }
  ]
}

